import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import AboutPage from './App';
import reportWebVitals from './reportWebVitals';

/* Create root element that will render my JS modules in index.html */
const root = ReactDOM.createRoot(document.getElementById('root'));

/* Custom HTML element */
const myFirstElement = <h1>A demo element</h1>

/* Ayyy OOP! But in JS! */
class Guy {
    constructor(name) {
        this.brand = name; /* Yes. Joe is a brand. */
    }
    name() {
        return "My name is " + this.brand;
    }
}

const joe = new Guy("Joe"); /* JS class declaration. Nothing new */

root.render(myFirstElement); /* Rendering my custom HTML header */ 
/* Pre-packaged app from Facebook when starting a new project */
// I customized some things like replacing the spinning icon, and changing background and text colors
// Apparently I can't enter text into the element renders
// notice: that the latest `root.render` call is what loads
// also notice: HTML elements that are capitalized are React components
// {joe.brand} is how I can provide data into HTNL elements
root.render(
  <React.StrictMode>
    <h1>Joe's name is {joe.brand}</h1>
    <App />
  </React.StrictMode>
);

// ### TODO
// - Figure out how to include the JumpStart html
